var tipuesearch = {"pages": [{'title': '簡介', 'text': '產品協同設計課程第三組 \n', 'tags': '', 'url': '簡介.html'}, {'title': '組員', 'text': '40623105\xa0 \n 40623109 \n 40623112 \n 40623118 \n 40623125 \n 40623127 \n 40623128 \n 40623135 \n 40623141 \n 40623156 \n \n', 'tags': '', 'url': '組員.html'}, {'title': '課程內容整理', 'text': '', 'tags': '', 'url': '課程內容整理.html'}, {'title': '隨身系統', 'text': '藉由自行製作隨身系統，來了解隨身系統的運作方式，以便了解工具的使用與設定，並可以量身打造所需的隨身系統。 \n', 'tags': '', 'url': '隨身系統.html'}, {'title': '創建資料夾', 'text': '創建一個放置可攜檔案的資料夾 \n 並在裡面 創建一個data資料夾用來連結y槽 \n', 'tags': '', 'url': '創建資料夾.html'}, {'title': 'SciTE', 'text': '安裝SciTE至data資料夾中 \n 使用windos的 \xa0 full download版本 \n SciTE Download: https://www.scintilla.org/SciTEDownload.html \n 打開SciTE後 \n 開啟設定檔案 \n \n 利用ctrl+f找到code.page並改為下圖所示 \n \n', 'tags': '', 'url': 'SciTE.html'}, {'title': '安裝 python 進可攜系統', 'text': '安裝時選取自訂義安裝 \n \n 勾選所需要的項目 \n \n \n 設定安裝位置 \n \n 利用 HxD 二位元編輯器設定C:\\p37\\Scripts\\pip.exe \n 使用ctrl+f功能尋找c :\\p37並改為y:\\p37 \n 如紅字處 \n \n \n 更改完成後就可以把整個p37資料夾移至data資料夾 \n', 'tags': '', 'url': '安裝 python 進可攜系統.html'}, {'title': 'start.bat', 'text': '利用安裝的SciTE製作start.bat檔案 \n \n', 'tags': '', 'url': 'start.bat.html'}, {'title': 'stop.bat', 'text': '利用安裝的SciTE製作stop.bat檔案 \n \n', 'tags': '', 'url': 'stop.bat.html'}, {'title': 'Kdiff3', 'text': '在製作過程中想要快速了解兩個檔案之間的差異可以使用Kdiff3來快速比對出不一樣的地方。 \n Kdiff3:  http://kdiff3.sourceforge.net/ \n', 'tags': '', 'url': 'Kdiff3.html'}, {'title': 'ungit-1', 'text': '使用圖形化介面讓使用者更加了解目前所在的分支與倉儲狀況 \n', 'tags': '', 'url': 'ungit-1.html'}, {'title': '如何安裝', 'text': '參考連結 http://mde.tw/wcm2019/content/%E5%AF%A6%E7%BF%92%E9%A0%85%E7%9B%AE%E4%BA%8C.html \n 至上方連結處下載 \xa0 nodejs_with_ungit.7z \n 下載完成後解壓縮到隨身系統資料夾的data中 \n 並在start.bat中加入 \n set USERPROFILE=%Disk%:\\home \n set path8=%Disk%:\\nodejs;%Disk%:\\nodejs\\appdata\\roaming\\npm; \n %path8%; \n 如下圖 \n \n \n 之後在中空白的SciTE中輸入 \n ungit --launchBrowser=0 --launchCommand "C:\\PROGRA~2\\Google\\Chrome\\Application\\chrome.exe\xa0 %%U" \n 存檔至Data中並命名為kungit.bat \n', 'tags': '', 'url': '如何安裝.html'}, {'title': 'ungit 手冊', 'text': '1.首先打開隨身碟命令提示字元，進入tmp下的組別資料夾，打 kungit \n \n 2.下圖為 ungit 開啟後的版面 \n \n 3.取得遠端資訊(Fetch from origin)：可以從近端查看想關注之遠端的資訊 \n ◎ origin : 為原本遠端的 github 網址 \n \n ◎取得想關注的遠端資料 \n \n (1)Name的地方打上想要的名稱， Url的地方貼上想要的網址 \n \n (2)送出後，再點選想要查看的網址名稱 \n \n (3)以下為點開後的圖面 \n \n', 'tags': '', 'url': 'ungit 手冊.html'}, {'title': 'ssh金鑰', 'text': '參考連結: https://2019wcm.blogspot.com/2019/03/github-github-pages.html \n', 'tags': '', 'url': 'ssh金鑰.html'}, {'title': '關閉跳出式登入窗', 'text': '首先 使用 git config --edit --system \n 叫出vi 編輯器,編輯git的設定檔案 \n 使用按鍵H,J,K,L控制上下左右 \n 案a進入編輯模式 \n 編輯模式最底下會顯示 \n -- INSERT -- \n 就可以按BACKSPACE刪除最後一行如下圖 \n \n 刪除後按ESC鍵離開編輯模式 \n 再輸入冒號後，再輸入wq存檔並關閉。 \n 如果要直接離開則輸入exit \n', 'tags': '', 'url': '關閉跳出式登入窗.html'}, {'title': '製作金鑰', 'text': '在 可攜系統的命令列視窗輸入sh或者是sh_yen(可至y:\\git\\bin中確認) \n 執行 Git 的 shell \n 並輸入 \n ssh-keygen -t rsa -b 4096 -C "This is my key" \n 將會建立Private 與 Public 金鑰至y:\\home\\.ssh\\id_rsa與id_rsa.pub \n 將 id_rsa.pub 的內容複製轉貼至Github 帳號的settings如下圖位置 \n \n \n \n 在SSH and GPG keys的SSH Key新建並貼上複製內容 \n', 'tags': '', 'url': '製作金鑰.html'}, {'title': '利用SSH提交推送', 'text': '首先要確認倉儲是以SSH的方式clone的 \n 利用以下指令clone或 \n git clone\xa0 git@github.com:倉儲擁有者/ 倉儲名 \n 或是直接利用SciTE開啟倉儲的.git檔案裡面的config \n 把url = https://github.com/ 倉儲擁有者/ 倉儲名 \n 改成url = git@github.com: 倉儲擁有者/ 倉儲名 \n 之後直接提交推送就可以不用打帳號密碼了 \n', 'tags': '', 'url': '利用SSH提交推送.html'}, {'title': '問題與討論', 'text': '', 'tags': '', 'url': '問題與討論.html'}, {'title': 'ungit-2', 'text': '', 'tags': '', 'url': 'ungit-2.html'}, {'title': '問題-無法取得使用者資料-已解決', 'text': '當使用ungit提交推送時，出現如下圖的錯誤內容 \n \n 解決方法: \n 至啟動隨身系統的start.bat中加入 \n set USERPROFILE=%Disk%:\\home \n 使ungit能找到 y:\\home中的使用者目錄 \n', 'tags': '', 'url': '問題-無法取得使用者資料-已解決.html'}, {'title': '組員操作影片', 'text': '', 'tags': '', 'url': '組員操作影片.html'}, {'title': '如何製作可攜系統', 'text': '40623105 \n \n 40623109 \n \n 40623118 \n \n \n \n 40623156 \n', 'tags': '', 'url': '如何製作可攜系統.html'}]};